import styles from "./Navigation.module.css";
const Navigation = () => {
  return (
    <header className={styles.header}>
      <div className={styles.left_header}>
        <div className={styles.left_div}>Logo</div>
        <div className={styles.left_div}>Login</div>
      </div>
      <nav>
        <ul>
          <li>My Orders</li>
          <li>My Profile</li>
          <li>Store</li>
          <li>Cart</li>
        </ul>
      </nav>
    </header>
  );
};

export default Navigation;
